//codigo

var ArraysJugadores = [];
var AGARTOOLS

var ip = $("#btn-dc-input").val().split("-")[2].split(".")[0];
console.log(ip);
function minimap(data) {
    console.log(data);
    var OBS = {
        "hostname": "minimap.agartool.io",
        reconnection: false,
        query: "server=" + encodeURIComponent(data.agarServer) + "&tag="
    }
   AGARTOOLS = io.connect(data.minimapServer, OBS);
    console.log(data.minimapServer + "?" + OBS.query)
    AGARTOOLS.on("command", EVENTOS);
    AGARTOOLS.on("connected", function (data) {
        console.log("se realizo la conexión: " + data);
    });
    AGARTOOLS.on("disconnect", function (data) {
        console.log("disconnect : " + data);
    });
    AGARTOOLS.on("connect_error", function (data) {
        console.log("Error de conexión : " + data);
    })

}

io.connect("wss://minimap.agartool.io:9000", {
    "hostname": "minimap.agartool.io",
    "query": "version=5&server=wss%3A%2F%2Flive-arena-"+ip+".agar.io%3A80",
}).on("info", function(d){
    minimap(d);
});

var EVENTOS = function (comandos) {
    if (void (0) == comandos.name) {
        return;
    }
    if (void (0) == comandos.playerName || "" == comandos.playerName ) {
        comandos.playerName = "Sin Nombre"
    }
    switch (comandos.name) {
        case "add": {
            if (void (0) === comandos.playerName) {
                comandos.playerName == "Sin Nombre"
            }
            ArraysJugadores.push(comandos);
            console.log(comandos.playerName);
            break;
        }
        case "remove": {
            remover(comandos.socketID);
            break;
        }
        case "position": { break; }
        case "customSkins": {

            /*
            customs: {꧁Wun Wun꧁Cℝ𝕀s☠%hunter: "//i.imgur.com/AFcSvjp.png"}
                     name: "customSkins"
            */
            console.log(comandos.customs);
            break;
        }
        case "reset": { break; }
        case "chat": {

            console.log(comandos.playerName);
            console.log(comandos.playerName == "");
            var Idm = parseInt(window.jQuery("#chat-message-area div:last-child").attr("data-messid")) + 1;
            var contenedor = window.jQuery("<div data-messid='" + Idm + "' class='chat-message'>");

            var span = window.jQuery("<span style='color: rgb(3,169,244)'>" + comandos.playerName + ":&ensp;</span>")
            var Mensaje = window.jQuery("<span>" + comandos.message + "</span>");

            contenedor.append(span).append(Mensaje);

           var chatmesa = window.jQuery("#chat-message-area").append(contenedor);
           chatmesa.css({"display":"block"});
            console.log(comandos);
            break;
        }
        case "command": { break; }
        case "ls": { break; }
        case "hc": { break; }
        default: {
            console.log("Evento no se reconoce :" + comandos.name);
        }

    }
}
$(".chat-input-message").keydown(function(event) {
    var key = (event.keyCode ? event.keyCode : event.which);
    if(key == 13){
        var MensajeVanilla = window.jQuery(".chat-input-message").val();
        var nick = window.jQuery(".nick").val();
        if(nick == "" || void(0) == nick){ nick = "Sin nombre" };

        AGARTOOLS.emit("command", {name: "chat", nick: nick, message: "LM:[Universal chat]:"+ MensajeVanilla})
    }
})

function remover(ID) {
    ArraysJugadores.forEach(element => {
        if (ArraysJugadores.socketID === ID) {
            var i = ArraysJugadores.indexOf(element);
            ArraysJugadores.slice(i, 1);
            console.log("Jugador " + ArraysJugadores.playerName + "Se Desconectado")
        }

    });
}